var tipuesearch = {"pages": [{'title': '介紹Github', 'text': '在深入了解python 的魅力所在後，相信你也會覺得程式很有趣。 \n \n 分別有三種狀態 \n 1. 已提交 (commited)>資料夾 \n 2. 已修改 (modified)>工作目錄(working directory)修改未儲存 \n 3. 已預存 (staged)>預存區(staging area)單一檔案(index) \n \n *用來儲存專案的後設資料及物件資料庫的地方 \n 流程 \n 1 .在工作目錄中修改檔案 \n 2 .預存檔案，檔案的快照新增到暫存區 \n 3 .提交，將檔案永久儲存在Git目錄中 \n \xa0', 'tags': '', 'url': '介紹Github.html'}, {'title': 'CMSimfly介紹', 'text': '在 https://github.com/chiamingyen/cmsimfly 的倉儲中，可學習到運作模式與他的原理。 \n 簡單來說。CMSimfly是在Python中缺一不可的重要角色之一。 \n 所有運作皆需要用到 CMSimfly。 \n 因此請好好摸索。 \n CMSimfly 的動態系統採用  Python3 + Flask  建構, 並且利用  Beatifulsoup  解讀位於 contig 目錄中的 content.htm 超文件檔案. \n content.htm 檔案可以透過動態系統中的 generate_pages 功能, 將超文件轉為位於 content 目錄中的個別頁面檔案. \n 動態系統與靜態系統則共用 downloads, images, static 等目錄, 其中 downloads 目錄存放在動態系統上傳的文件檔, 而 images 目錄則存放動態系統所上傳的影像檔案, 包括 jpg, png 與 gif 等格式圖檔. \n static 目錄則存放在動態與靜態系統所需要的 Javascript 或 Brython 程式檔. \n', 'tags': '', 'url': 'CMSimfly介紹.html'}, {'title': '版本', 'text': 'CMSimfly 目前使用 Syntaxhighlighter 3.0.83: \n \xa0 http://alexgorbatchev.com/SyntaxHighlighter/ \xa0 \n 進行頁面中的程式碼高亮顯示. \n', 'tags': '', 'url': '版本.html'}, {'title': 'Python簡介', 'text': '\n 容易撰寫 \n Python 通常可以靠比較短的程式碼完成比較多的功能，或者可以寫得比較清楚。 \n 功能強大 \n 絕大部分都是開放原始碼的，與主要作業系統的支援功能等等，含括的範圍非常地廣泛。 \n 跨平台 \n 各種主要的作業系統都支援 Python。不需要修改。所撰寫的程式透過標準的模組進行包裝後，用標準的方式即可安裝於各種平台。 \n 容易擴充 \n 為執行效率不錯的直譯式語言。Python本身被設計為可擴充的。因此，有很多人把Python作為一種「膠水語言」（glue language）使用。使用Python將其他語言編寫的程式進行整合和封裝。 \n', 'tags': '', 'url': 'Python簡介.html'}, {'title': '術語解說', 'text': '編譯器 \n 將程式碼編譯為機器碼，再加以執行，用編譯語言寫成的程式，在執行期的執行速度，通常比用直譯語言寫的程式快。因為程式在編譯期，已經被預先編譯成機器碼，可以直接執行。 \n 直譯語言 \n 直譯語言是一種程式語言，會將程式碼一句一句直接執行，不需要像編譯語言一樣，經過編譯器先行編譯為機器碼，之後再執行。 \n 高階程式語言 \n 是高度封裝了的程式語言。以人類的日常語言為基礎的一種程式語言，使用一般人易於接受的文字來表示，有較高的可讀性，以方便對電腦認知較淺的人亦可以大概明白其內容。 \n 低階程式語言 \n 為電腦科學相關的術語，指的是一類電腦程式語言。它很少提供或不提供電腦的指令集體系結構->也就是語言對映中與處理器指令緊密相關的命令或函式。 \n \xa0 \n . \n', 'tags': '', 'url': '術語解說.html'}, {'title': 'History of Python', 'text': '為廣泛使用的高階程式語言，由 吉多·范羅蘇姆 創造，作為一種 直譯語言 ，設計哲學強調程式碼的可讀性和簡潔的語法，讓開發者能夠用更少的代碼表達想法，該語言都試圖讓程式的結構清晰明了。 \n 從 ABC 發展而來的，雖然被粗略地分類為「指令碼語言」，但實際上一些大規模軟體開發計劃例如Zope、Mnet及BitTorrent，Google也廣泛地使用它。 \n Python的支持者較喜歡稱它為一種 高階動態程式語言 ， 原因是「指令碼語言」泛指僅作簡單程式設計任務的語言。 \n 而正式直譯器CPython是用 C語言 編寫的、是一個由社群驅動的自由軟體。 \n 支援多種編程範式 ，包括物件導向、命令式、函數式和程序式編程，本身擁有一個巨大而廣泛的標準庫。 \n \xa0 \n \xa0 \n \n \n', 'tags': '', 'url': 'History of Python.html'}, {'title': '基本設定操作', 'text': '主要複習上學期的教學課程內容與增加學期中所操作時的心得 \n https://www.ithome.com.tw/news/95283 \n 以上網址可較認識到GIT的操作與功用 \n', 'tags': '', 'url': '基本設定操作.html'}, {'title': '創建Github帳號', 'text': '\n 1. 先到github之網站點選創建帳號 \n \n 2. 之後會測試是否為機器人操作，下一階段為填寫為何需要github的表單，可選擇填寫(看個人)，填寫完畢即可直接進入github使用軟體。 \n \n', 'tags': '', 'url': '創建Github帳號.html'}, {'title': '設定Python和Proxy的代理主機', 'text': '開啟proxy伺服器設定，之後得知正確分享器以 DHCP client 取得 192.168.1.* 的網路位址，連接成功後開啟儲存，即可完成。 \n \n 1. 進入Proxy裡設定 \n \n 2. 輸入伺服器網路位置 \n \n 3. 儲存後重新連接即可獲取該伺服器之網路。 \n', 'tags': '', 'url': '設定Python和Proxy的代理主機.html'}, {'title': '進入倉儲之步驟', 'text': '\n 1 . 先複製倉儲之網址 \n \n 2. 之後git clone下來 \n \n 3. 下載完成後打開近端 \n \n 4. 複製網址後Login完即可對倉儲改版 \n \n', 'tags': '', 'url': '進入倉儲之步驟.html'}, {'title': '更新倉儲改版', 'text': '\n 1. 先個別clone下來兩個需將合併的倉儲。 \n 一.先下載新版倉儲資訊。 \n \n 二.再下載自己的倉儲。 \n \n 2. 之後複製貼上需要更新的資料並蓋 過，即可完成。 \n \n *補 : 原本倉儲中config目錄不須被覆蓋，因為裡面的資料是在倉儲中所有變動的紀錄，假設被新版倉儲覆蓋將會遺失所有更改資料。', 'tags': '', 'url': '更新倉儲改版.html'}, {'title': '找尋倉儲網址', 'text': '1. 在倉儲setting裡可更改。 \n \n 2. 之後變更完成即可找到倉儲網址。 \n', 'tags': '', 'url': '找尋倉儲網址.html'}, {'title': '程式操作運用', 'text': '\n \n 1. 先到mde.tw之 網際內容管理網誌 點選 20 19_cdb_w5.7z \xa0下載 \n \n 2. 開始練習指令 \n D: \xa0 \xa0 去D槽之區域 \n cd\xa0 \xa0 進入資料夾 \n cd \\\xa0 \xa0or\xa0cd . 返回根目錄 \n git init\xa0 增加數據庫 \n git clone 下載(後面需增加網址) \n git add .\xa0 \xa0 快照，將工作區資料加入索引 \n git status 確認工作目錄與索引狀態 \n git pull 檢查近遠端是否連接 \n git commit -m "檔案名稱" 推送上去之前所包裝之資料夾 \n git push 推送(會問帳號密碼) \n git branch 查看分支 \n git merge(分支名稱) \xa0 將某分支合併到目前分支，有commit \n git rebase(分支名稱)\xa0 將目前分支合併到某分支中，不會有commit \n git\xa0 checkout \xa0 將開端移動HEAD \n git log 檢視提交紀錄 \n git log --oneline --graph --all 要求出現開頭的列表 \n git diff 查看上一個資料 \n git stash 移除上一個資料 \n python\xa0 --version 查看python之版本 \n git remote\xa0 顯示遠端儲存庫 \n git clean\xa0 刪除工作區中未被追蹤的文件', 'tags': '', 'url': '程式操作運用.html'}, {'title': '各種程式範例', 'text': '', 'tags': '', 'url': '各種程式範例.html'}, {'title': 'Java 程式碼', 'text': 'import java.util.Scanner;\n\npublic class Life {\n    public static void show(boolean[][] grid){\n        String s = "";\n        for(boolean[] row : grid){\n            for(boolean val : row)\n                if(val)\n                    s += "*";\n                else\n                    s += ".";\n            s += "\\n";\n        }\n        System.out.println(s);\n    }\n    \n    public static boolean[][] gen(){\n        boolean[][] grid = new boolean[10][10];\n        for(int r = 0; r < 10; r++)\n            for(int c = 0; c < 10; c++)\n                if( Math.random() > 0.7 )\n                    grid[r][c] = true;\n        return grid;\n    }\n    \n    public static void main(String[] args){\n        boolean[][] world = gen();\n        show(world);\n        System.out.println();\n        world = nextGen(world);\n        show(world);\n        Scanner s = new Scanner(System.in);\n        while(s.nextLine().length() == 0){\n            System.out.println();\n            world = nextGen(world);\n            show(world);\n            \n        }\n    }\n    \n    public static boolean[][] nextGen(boolean[][] world){\n        boolean[][] newWorld \n            = new boolean[world.length][world[0].length];\n        int num;\n        for(int r = 0; r < world.length; r++){\n            for(int c = 0; c < world[0].length; c++){\n                num = numNeighbors(world, r, c);\n                if( occupiedNext(num, world[r][c]) )\n                    newWorld[r][c] = true;\n            }\n        }\n        return newWorld;\n    }\n    \n    public static boolean occupiedNext(int numNeighbors, boolean occupied){\n        if( occupied && (numNeighbors == 2 || numNeighbors == 3))\n            return true;\n        else if (!occupied && numNeighbors == 3)\n            return true;\n        else\n            return false;\n    }\n\n    private static int numNeighbors(boolean[][] world, int row, int col) {\n        int num = world[row][col] ? -1 : 0;\n        for(int r = row - 1; r <= row + 1; r++)\n            for(int c = col - 1; c <= col + 1; c++)\n                if( inbounds(world, r, c) && world[r][c] )\n                    num++;\n\n        return num;\n    }\n\n    private static boolean inbounds(boolean[][] world, int r, int c) {\n        return r >= 0 && r < world.length && c >= 0 &&\n        c < world[0].length;\n    }\n\n} \n', 'tags': '', 'url': 'Java 程式碼.html'}, {'title': 'Python 程式碼', 'text': 'def parse_content():\n    """use bs4 and re module functions to parse content.htm"""\n    #from pybean import Store, SQLiteWriter\n    # if no content.db, create database file with cms table\n    \'\'\'\n    if not os.path.isfile(config_dir+"content.db"):\n        library = Store(SQLiteWriter(config_dir+"content.db", frozen=False))\n        cms = library.new("cms")\n        cms.follow = 0\n        cms.title = "head 1"\n        cms.content = "content 1"\n        cms.memo = "first memo"\n        library.save(cms)\n        library.commit()\n    \'\'\'\n    # if no content.htm, generate a head 1 and content 1 file\n    if not os.path.isfile(config_dir+"content.htm"):\n        # create content.htm if there is no content.htm\n        File = open(config_dir + "content.htm", "w", encoding="utf-8")\n        File.write("<h1>head 1</h1>content 1")\n        File.close()\n    subject = file_get_contents(config_dir+"content.htm")\n    # deal with content without content\n    if subject == "":\n        # create content.htm if there is no content.htm\n        File = open(config_dir + "content.htm", "w", encoding="utf-8")\n        File.write("<h1>head 1</h1>content 1")\n        File.close()\n        subject = "<h1>head 1</h1>content 1"\n    # initialize the return lists\n    head_list = []\n    level_list = []\n    page_list = []\n    # make the soup out of the html content\n    soup = bs4.BeautifulSoup(subject, \'html.parser\')\n    # 嘗試解讀各種情況下的標題\n    soup = _remove_h123_attrs(soup)\n    # 改寫 content.htm 後重新取 subject\n    with open(config_dir + "content.htm", "wb") as f:\n        f.write(soup.encode("utf-8"))\n    subject = file_get_contents(config_dir+"content.htm")\n    # get all h1, h2, h3 tags into list\n    htag= soup.find_all([\'h1\', \'h2\', \'h3\'])\n    n = len(htag)\n    # get the page content to split subject using each h tag\n    temp_data = subject.split(str(htag[0]))\n    if len(temp_data) > 2:\n        subject = str(htag[0]).join(temp_data[1:])\n    else:\n        subject = temp_data[1]\n    if n >1:\n            # i from 1 to i-1\n            for i in range(1, len(htag)):\n                head_list.append(htag[i-1].text.strip())\n                # use name attribute of h* tag to get h1, h2 or h3\n                # the number of h1, h2 or h3 is the level of page menu\n                level_list.append(htag[i-1].name[1])\n                temp_data = subject.split(str(htag[i]))\n                if len(temp_data) > 2:\n                    subject = str(htag[i]).join(temp_data[1:])\n                else:\n                    subject = temp_data[1]\n                # cut the other page content out of htag from 1 to i-1\n                cut = temp_data[0]\n                # add the page content\n                page_list.append(cut)\n    # last i\n    # add the last page title\n    head_list.append(htag[n-1].text.strip())\n    # add the last level\n    level_list.append(htag[n-1].name[1])\n    temp_data = subject.split(str(htag[n-1]))\n    # the last subject\n    subject = temp_data[0]\n    # cut the last page content out\n    cut = temp_data[0]\n    # the last page content\n    page_list.append(cut)\n    return head_list, level_list, page_list\n\n \n', 'tags': '', 'url': 'Python 程式碼.html'}, {'title': 'C或C++程式碼', 'text': '請注意, 目前 CMSimfly 標題內文無法解讀 "/" 符號, 因此若本頁面的標題為\xa0 "C/C++程式碼", 則無法進行分頁. \n /* Runge Kutta for a set of first order differential equations */\n \n#include <stdio.h>\n#include <math.h>\n \n#define N 2 /* number of first order equations */\n#define dist 0.1 /* stepsize in t*/\n#define MAX 30.0 /* max for t */\n \nFILE *output; /* internal filename */\nFILE *output1; /* internal filename */\n// 利用 pipe 呼叫 gnuplot 繪圖\nFILE *pipe;\n \nvoid runge4(double x, double y[], double step); /* Runge-Kutta function */\ndouble f(double x, double y[], int i); /* function for derivatives */\n \nvoid main(){\n \n  double t, y[N];\n  int j;\n \n  output=fopen("osc.dat", "w"); /* external filename */\n  output1=fopen("osc1.dat", "w"); /* external filename */\n \n  y[0]=1.0; /* initial position */\n  y[1]=0.0; /* initial velocity */\n \n  //fprintf(output, "0\\t%f\\n", y[0]);\n \n  for (j=1; j*dist<=MAX ;j++) /* time loop */{\n \n    t=j*dist;\n    runge4(t, y, dist);\n    fprintf(output, "%f\\t%f\\n", t, y[0]);\n    fprintf(output1, "%f\\t%f\\n", t, y[1]);\n  }\n \n  fclose(output);\n  fclose(output1);\n \n  pipe = popen("gnuplot -persist","w");\n  //fprintf(pipe,"set term png enhanced font \\"v:/fireflysung.ttf\\" 18 \\n");\n  fprintf(pipe,"set term png enhanced font \\"y:/wqy-microhei.ttc\\" 18 \\n");\n  //fprintf(pipe,"set yrange [68:70]\\n");\n  fprintf(pipe,"set output \\"test.png\\"\\n");\n  fprintf(pipe, "plot \\"osc.dat\\" title \\"位移\\" with lines, \\"osc1.dat\\" title \\"速度\\" with lines\\n");\n  fprintf(pipe,"quit\\n");\n\n  fprintf(pipe,"quit\\n");\n  pclose(pipe);\n}\n \nvoid runge4(double x, double y[], double step){\n \n  double h=step/2.0, /* the midpoint */\n  t1[N], t2[N], t3[N], /* temporary storage arrays */\n  k1[N], k2[N], k3[N],k4[N]; /* for Runge-Kutta */\n  int i;\n \n  for (i=0;i<N;i++){\n \n    t1[i]=y[i]+0.5*(k1[i]=step*f(x,y,i));\n  }\n \n  for (i=0;i<N;i++){\n \n    t2[i]=y[i]+0.5*(k2[i]=step*f(x+h, t1, i));\n  }\n \n  for (i=0;i<N;i++){\n \n    t3[i]=y[i]+ (k3[i]=step*f(x+h, t2, i));\n  }\n \n  for (i=0;i<N;i++){\n \n    k4[i]= step*f(x+step, t3, i);\n  }\n \n  for (i=0;i<N;i++){\n \n    y[i]+=(k1[i]+2*k2[i]+2*k3[i]+k4[i])/6.0;\n  }\n}\n \ndouble f(double x, double y[], int i){\n \n  if (i==0)\n    x=y[1]; /* derivative of first equation */\n  if (i==1)\n    x=-y[0]-0.5*y[1];\n  return x;\n} \n', 'tags': '', 'url': 'C或C++程式碼.html'}, {'title': 'Lua 程式碼', 'text': '-- 導入 js 模組\njs = require("js")\n-- 取得 window\nwindow = js.global\n-- 猜小於或等於 n 的整數\nbig = 100\n-- 計算猜測次數, 配合 while 至少會猜一次\nnum = 1\n-- 利用 window:prompt 方法回應取得使用者所猜的整數\nguess = window:prompt("請猜一個介於 1 到 "..big.." 的整數")\n-- 利用數學模組的 random 函數以亂數產生答案\nanswer = math.random(big)\noutput = ""\n-- 若沒猜對, 一直猜到對為止\nwhile answer ~= tonumber(guess) do\n    if answer > tonumber(guess) then\n        output = "猜第 "..num.." 次, guess="..guess..", answer="..answer.." - too small"\n        print(output)\n    else\n        output = "猜第 "..num.." 次, guess="..guess..", answer="..answer.." - too big"\n        print(output)\n    end \n    guess = window:prompt(output..", 請猜一個介於 1 到 "..big.." 的整數")\n    num = num + 1\nend\nprint("總共猜了 "..num.." 次, answer=guess="..answer.." - correct")\n     \n', 'tags': '', 'url': 'Lua 程式碼.html'}, {'title': 'Javascript 程式碼', 'text': 'STLViewer = function(stlpath, plotarea) {\n\n\tvar mycanvas = document.getElementById(plotarea);\n\tvar viewer = new JSC3D.Viewer(mycanvas)\n\tvar theScene = new JSC3D.Scene;\n\t////Initialize with a default file:\n\t//var stlpath = "../../../assets/2013-10-23/stl/box.STL"\n\t//var stlpath = "../../../assets/2013-10-23/stl/taj.stl"\n\tviewer.setParameter(\'SceneUrl\', stlpath);\n    viewer.setParameter(\'InitRotationX\', 20);\n\tviewer.setParameter(\'InitRotationY\', 20);\n\tviewer.setParameter(\'InitRotationZ\', 0);\n\tviewer.setParameter(\'ModelColor\', \'#CAA618\');\n\tviewer.setParameter(\'BackgroundColor1\', \'#FFFFFF\');\n\tviewer.setParameter(\'BackgroundColor2\', \'#383840\');\n\tviewer.init();\n\tviewer.update();\n\t////init done\n\tvar canvas_drop = document.getElementById(\'canvas-drop\')\n\t/*var dropzone = document.getElementById(\'dropzone\')\n\tdropzone.addEventListener(\'dragover\', handleDragOver, false);\n\tdropzone.addEventListener(\'drop\', handleFileSelect, false); */\n\tcanvas_drop.addEventListener(\'dragover\', handleDragOver, false);\n\tcanvas_drop.addEventListener(\'drop\', handleFileSelect, false);\n\n////Drag and drop logic:\n\tfunction handleFileSelect(evt) {\n\t    evt.stopPropagation();\n\t    evt.preventDefault();\n\t    var files = evt.dataTransfer.files;\n\t    console.log(evt)\n\t    console.log(files)\n\t    preview_stl(files[0])\n\t  }\n\n\t  function handleDragOver(evt) {\n\t    evt.stopPropagation();\n\t    evt.preventDefault();\n\t    evt.dataTransfer.dropEffect = \'copy\';\n\t  }\n\n////jsc3d logic\n\tvar handle_file_select = function(e) {\n\t\te.stopPropagation()\n\t\te.preventDefault()\n\t\tvar f = e.target.files[0]\n\t\tpreview_stl(f)\n\t}\n\n\tfunction preview_stl(f) {\n\t\tvar reader = new FileReader()\n\t\tvar ext = f.name.split(".")[1]\n\n\t\tfunction setup_viewer() {\n\t\t\tviewer.setParameter(\'InitRotationX\', 20);\n\t\t\tviewer.setParameter(\'InitRotationY\', 20);\n\t\t\tviewer.setParameter(\'InitRotationZ\', 0);\n\t\t\tviewer.setParameter(\'ModelColor\', \'#CAA618\');\n\t\t\tviewer.setParameter(\'BackgroundColor1\', \'#FFFFFF\');\n\t\t\tviewer.setParameter(\'BackgroundColor2\', \'#383840\');\n\t\t\tviewer.setParameter(\'RenderMode\', "flat");\n\t\t}\n\t\tsetup_viewer()\n\n\t\treader.onload = (function(file) {\n\t\t\treturn function(e) {\n\t\t\t\ttheScene = new JSC3D.Scene\n\t\t    \tstl_loader = new JSC3D.StlLoader()\n\t\t    \tstl_loader.parseStl(theScene, e.target.result)\n\t\t      \t//viewer.init()\n\t\t      \tviewer.replaceScene(theScene)\n\t\t      \tviewer.update()\n\t\t      \tconsole.log("file reader onload")\n\t\t\t}\n\t\t})(f)\n\n\t\tif (ext.toLowerCase() != "stl") {\n\t\t\talert("That doesn\'t appear to be an STL file.");\n\t\t} else {\n\t\t\treader.readAsBinaryString(f)\n\t\t}\n\t}\n}\n \n', 'tags': '', 'url': 'Javascript 程式碼.html'}, {'title': 'Html 原始碼', 'text': '<html>\n   <head>\n      <meta http-equiv="content-type" content="text/html;charset=utf-8">\n      <title>CMSimfly</title>\n      <link rel="stylesheet" type="text/css" href="/static/cmsimply.css">\n   </head>\n   <body>\n      <div class=\'container\'>\n      <nav>\n         <ul id=\'css3menu1\' class=\'topmenu\'>\n            <li><a href=\'/get_page/簡介\'>簡介</a>\n            <li><a href=\'/get_page/目錄結構\'>目錄結構</a>\n            <li>\n               <a href=\'/get_page/頁面編輯\'>頁面編輯</a>\n               <ul>\n                  <li>\n                     <a href=\'/get_page/插入程式碼\'>插入程式碼</a>\n                     <ul>\n                        <li><a href=\'/get_page/Java 程式碼\'>Java 程式碼</a>\n                        <li><a href=\'/get_page/Python 程式碼\'>Python 程式碼</a>\n                        <li><a href=\'/get_page/C或C++程式碼\'>C或C++程式碼</a>\n                        <li><a href=\'/get_page/Lua 程式碼\'>Lua 程式碼</a>\n                        <li><a href=\'/get_page/Javascript 程式碼\'>Javascript 程式碼</a>\n                        <li><a href=\'/get_page/Html 原始碼\'>Html 原始碼</a></li>\n                        </li>\n                     </ul>\n               </ul>\n            <li><a href=\'/get_page/網際簡報\'>網際簡報</a>\n            <li><a href=\'/get_page/網誌編輯\'>網誌編輯</a>\n            <li><a href=\'/get_page/已知錯誤\'>已知錯誤</a></li>\n         </ul>\n      </nav>\n      <section>\n         <form method=\'post\' action=\'/ssavePage\'>\n         <textarea class=\'simply-editor\' name=\'page_content\' cols=\'50\' rows=\'15\'><h3>Html 原始碼</h3></textarea>\n         <input type=\'hidden\' name=\'page_order\' value=\'9\'>\n         <input type=\'submit\' value=\'save\'>\n         <input type=button onClick="location.href=\'/get_page/Html 原始碼\'" value=\'viewpage\'>\n         </form>\n      </section>\n   </body>\n</html>\nCOPY TO CLIPBOARD\t \n', 'tags': '', 'url': 'Html 原始碼.html'}, {'title': '修正錯誤', 'text': '\n 期中問題 \n 1. 單機與網路差別 \n \xa0\xa0 單機之資料庫只供本機使用，網路之資料庫為透過區域網路設定可供多人共用。 \n 2 . 為什麼協同反而無法取得正確近端 \n \xa0因為協同後，需要pull request才能真正取得倉儲之近端，在指令馬中打git pull，即可將近端 \n \xa0遠端統合， 便可把資料push上去。 \n 3. 兩個人同時 用近端 並同時上傳檔案，但有合併衝突怎麼辦 \n \xa0先將.htm檔拖曳到SciTE文字編輯器，找出衝突點，並刪除頭(<<<<<<<)尾(>>>>>>>)與接\xa0合處 (=======)後，儲存並重新進入近端，將之轉成Generapage，最後git add .\xa0 gitcommit \n \xa0\xa0 git push。 \n 4 . 為什麼倉儲會突然找不到網頁，但在遠端還可以看到 \n 有可能是因為檔案中又包住另一個git clone 下來的資料，造成程式碼衝突，因而，使得變成404網頁。 \n \xa0* 處理方式:建議不要將檔案連續包夾在同一個資料夾裡面。 \n 5. 為什麼更改字型但是網頁爆掉 \n 由於前後自行更改大小不一，因而造成網頁爆掉，需要到SciTE去刪除設定大小的前後(head3) \n 即可救回網頁。 P.S.建議不要隨便更改字型大小。 \n 6. 網頁爆掉如何救回 \n 檢視問題點在哪行程式碼，將之移除，並重新檢視、送出，以下為指令: \n Git log (查看從最近到最遠得提交日誌) \n Git checkout 7碼 (丟棄工作區文檔的修改) \n Git status (查看當前git倉儲狀態) \n Git diff  (查看修改的文檔內容) \n Git status (查看當前git倉儲狀態) \n Git stash (將寫到一半的代碼從工作區拿走存起來) \n Git status (查看當前git倉儲狀態) \n 期末問題 \n 1. 新版與舊版倉儲產生倉儲 \n 將舊版倉儲一律改版成新版，在原先舊版資料檔中保存config目錄，之後將新版倉儲資料複製撇除git檔全部覆蓋後，重新進入近端推送變更資料後即可解決衝突問題。 \n 補:假如沒有去做更新改版的動作，可能會導致資料推送不完整或是push不上去的問題。 \n 可參考以下影片操作 \n \n 2. 資料推送不上去 \n \n 可參考以下應片來解決，最有影響的部分可能在於近端遠端沒有做統一彙整成一樣的，導致資訊核對時產生錯誤，應使用git pull解決，之後再確認其他部分是否成立，並commit，即可解決此問題。 \n \n (圖為push產生問題範例) \n 3. 組別倉儲在推送後其他組員也剛好在改版，因而產生版面衝突 \n 在新版推送完畢後，組員使用舊版要推送之時產生衝突，會有一些指示建議你，大概會使用到.... \n git pull \n git commit \n git status \n git add . \n git merge \n 這些指令會一直無限循環到推送完成。 \n \n 將.htm檔拖曳到SciTE文字編輯器，找出衝突點，並刪除頭(<<<<<<<)尾(>>>>>>>)與接\xa0合處 (=======)後儲存， 之後再次確認是否改版，進入近端查看發現會有一些地方重複而產生錯誤版面，去編輯將重複的資訊刪除再重新推送，即可完成最新版的倉儲。 \n 4. 資料上傳不上去導至網頁錯誤的原因 \n Y:\\>cd project \n Y:\\project>dir \n Y:\\project>cd cmstest>更換目錄到contest \n Y:\\project\\cmstest>python wsgi.py \n 進入address可改版，一˙但改版可進行版次推送 \n Login完week2打入根據[...網址...]完成ungit的配置，按github page，回到ungit網頁，push上去。 \n 假如網頁出現錯誤: \n 由於沒有在Home底下有對應的git config \n Home(外部)\xa0 \xa0 Home_cadlab(內部) \n 先檢查有無gitconfig! \n 5. 為何在編輯網頁時同樣標題會產生衝突 \n 由於程式無法判別先後順序，因此產生錯亂，假設要編輯時會出現以下範例模樣 \n \n 解決辦法:刪除產生衝突之字眼或更改，儲存完成便會回復原本頁面。 \n \n 6. 無法git clone資料 \n 原因: \n 1 >git不能執行 \n 2 >git可以執行，倉儲不對 \n 3 >git可執行，倉儲對，數字不對\xa0 \n 以上幾點設定路徑與位置都用好基本上可以下載成功。 \n', 'tags': '', 'url': '修正錯誤.html'}, {'title': '進階挑戰', 'text': '挑戰更加困難也繁瑣的操作. \n \n .', 'tags': '', 'url': '進階挑戰.html'}, {'title': '設定路徑說明', 'text': '導入ungit \n nodejs裡面有ungit->程式為nodejs所寫，nodejs位置在 appdata->roming->npm->ungi \xa0。 \n 程式碼在appdata->roming->npm->node-modules->ungit->CHANGELOG.md。 \n \xa0 \n start.bat跟start.cadlab.bat差別 \n 因Home位置不同，適用範圍有所不同!! \n start.bat=>學校外適用。 \n start.cadlab.bat=>學校內適用，不能使用在學校外的地方。 \n \n STAPE1 \n \n 1 .設定路徑=> \n \xa0 \xa0 set path8=%Disk%:\\nodejs;%Disk%:\\nodejs\\appdata\\roaming\\npm;放置到start.cadlab的sciTE裡\xa0 \xa0 \xa0 的path7後。 \n \n 2 .將 path8 納入 path 設定=> \n \xa0 \xa0 %path8%；->讓nodejs.ungit直行即可使用。 \n \n \xa0 \xa0 在同上步驟中的sciTE中有path程式碼將%path8%；直接放在最後方。 \n \n \n \xa0 \n \n \n 3 .分別start.bat跟start.cadlab.bat都如上兩步驟操作並儲存。 \n \n \n \xa0 \n \n \n 4 .按start.cadlab.bat打入ungit可作執行，之後出現頁面表示設定成功，按允許儲存，再將跳出\xa0 \xa0 \xa0 \xa0 的網頁關掉。 \n \n \n \xa0 \n \n \n 5 .針對nodejs設定路徑=> \n \n \n \xa0 \xa0 [set. USERPROFILE=%Disk%:\\home]start.cadlab.bat中需加入以上程式碼\xa0\xa0\xa0\xa0\xa0 \xa0 \xa0 \xa0 \xa0 \xa0\xa0在\xa0set.HOME=%Disk%:\\home-cadlab之下方增加。 \n \n \n \xa0 *將以上程式關掉(剛才使用的程式碼還不用關。若關掉，kmol-2019->data->scite->bin->按\xa0 \xa0 \xa0 \xa0 \xa0 scite黑色圓點。 \n \n \n 以便能作動，因nodejs系統user的路徑找git的設定檔，但找不到，又因為需變為可攜程式，必須透過上述方式來作動!! \n \n \n 6 .start.bat也是上述步驟重複一遍。完成初步動作。。。。。 \n \n STAPE2 \n \n 可在mde.tw中2019 spring...裡，實習任務之任務2有明確步驟可找到下面的程式。 \n \n \n ungit --launchBrowser=0 --launchCommand "C:\\PROGRA~2\\Google\\Chrome\\Application\\chrome.exe\xa0 %U" \n \n \n 需使用簡寫，不然無法啟動。並新建批次檔。 \n', 'tags': '', 'url': '設定路徑說明.html'}, {'title': '新建批次檔步驟', 'text': 'Q 如何建立批次檔 ? \n \n Step1 ；去SciTe新建檔案>將程式複製貼上 >Save as 在隨身碟Y槽 \n \xa0 \xa0 \xa0 \n \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0[為了與ungit作區別，因此將其名稱為kungit.bat]>從可攜home找出對應的git \n \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 設定 \n \n Step2 :去隨身碟Y槽>home>查看有無git設定>沒有的話測試程式碼能否運作>git clone測試網頁 \n \n 打開ungit在CMS下面的各時間提交之內容>[進入測試網頁>打kungit指令] \n \xa0 \xa0 \xa0 \xa0 \n \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 條件 :\xa0 1.必須在某個git倉儲下指令(cd....)>目的為由Chrom開啟 \n \n \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 2.必須啟動ungit對應的的\\批次檔。 \n \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0為了確保關閉nodejs不干擾運作，下載process explorer ，取64....的Z複製下來，貼在y槽以便隨時關閉程式。 \n 找到在最下面的綠色node按右鍵kill process>把nodejs上次對應的8443的批次檔關閉，指令便可正常運作。(即可不會抱怨。) \n 刪除nodejs之8443的批號後，重新打入kungit指令即可看到ungit網頁跳出。 \n', 'tags': '', 'url': '新建批次檔步驟.html'}, {'title': '改版全班倉儲推送合併操作', 'text': '\n 在經由老師教導後自行操作的指令過程閱覽。 \n 其中操作順序指令依序為: \n 1. git checkout -b 名稱 master \n \n 2. git pull 網址\xa0 \n \n 3. git status \n \n 4. git branch 和git add . \n \n 5. git merge --no-ff 名稱 \n \n 6. git push和git pull \n \n 在經過一連串反覆使用這些指令的下，最終即可推送完成，如果不確定是否推送成功，可再次進入近端遠端查看是否一切操作程序正常。 \n * 如都確認完成遠端網頁如下範例: \n \n 全班網頁推送改版完成。 \n \n', 'tags': '', 'url': '改版全班倉儲推送合併操作.html'}, {'title': 'Virtualbox老師主旨', 'text': '\n 利用 Virtualbox 建立虛擬 Ubuntu 18.04 網際內容管理系統伺服主機: 1 . 安裝最新版的 Virtualbox 2 . 建立 Ubuntu 18.04 虛擬主機 3 . 以網路卡橋接啟動 Ubuntu 伺服器 4 . 以 sudo apt install nginx 安裝 nginx WWW 伺服器 5 . 以 ifconfig 查 Ubuntu 伺服器的 IP, 測試 nginx 伺服器是否可以連線 6 . 以 Windows 10\xa0 下的 Filezilla client, 將編輯好的 nginx 設定檔案送到 Ubuntu 7 .\xa0利用 Ubuntu 指令將設定檔案搬至設定位置後, 以 /etc/init.d/nginx restart 重新啟動 nginx 8 . 在 Ubuntu 中以 sudo apt install uwsgi 安裝 uwsgi 9 . 在 Windows 10 編輯 uwsgi 與 nginx 所需的設定檔案, 完成後以 filezilla 送至 Ubuntu. 10 . 將 CMSimfly 程式碼送到 Ubuntu 伺服器中對應目錄後. 11 . 在 Ubuntu 建立 cmsimfly 服務, 並設定隨機啟動. 12 . 完成後, 在 Windows 10 以瀏覽器連線至 CMSimfly, 確認動態網頁與靜態網頁可以在虛擬主機中正常啟動. 13 . 以上相關網際內容管理在機械工程相關應用可參考:\xa0 https://www.driveworks.co.uk \xa0或\xa0 https://robotbenchmark.net/', 'tags': '', 'url': 'Virtualbox老師主旨.html'}, {'title': 'Virtualbox介紹', 'text': '\n 能夠安裝多個客戶端作業系統，每個客戶端系統皆可獨立開啟、暫停與停止。 \n 主端作業系統與客戶端作業系統皆能相互通訊，多個作業系統同時運行的環境，也彼此能夠同時使用網路。 \n \n 支援64位元客戶端作業系統，即使主機使用 32位元 CPU (6.0版後主機僅支援64位元作業系統) [5] \n 支援 SATA 硬碟 NCQ 技術 \n 虛擬硬碟快照 \n 無縫視窗模式（須安裝客戶端驅動程式） \n 能夠在主機端與客戶端共用剪貼簿（須安裝客戶端驅動） \n 在主機端與客戶端間建立共用資料夾（須安裝客戶端驅動） \n 內建遠端桌面伺服器 \n 支援VMware VMDK磁碟檔及Virtual PC VHD磁碟檔格式 \n 3D虛擬化技術支援OpenGL（2.1版後支援）、Direct3D（3.0版後支援）、WDDM（4.1版後支援） \n 最多虛擬32顆 CPU （3.0版後支援） \n 支援VT-x與AMD-V硬體虛擬化技術 \n iSCSI支援 \n USB與USB2.0支援 \n \n 總結:虛擬電腦可增加操作城市的便利性。 \n \n', 'tags': '', 'url': 'Virtualbox介紹.html'}, {'title': 'Virtualbox下載步驟', 'text': '1. 搜尋Virtualbox[關鍵字，點進去會是這個畫面 \n \n 2. 之後點入Download\xa0Virtualbox6.的綠色大框，出現畫面點選紅框內的下載連結 \n \n 3. 下載好後開啟Virtualbox \n \n \n \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 (圖例) \n 4. 點選下一步，選取放置位置 \n \n 5. 點選下一步，選取以下選項 \n \n 6. 點選下一步來到安裝頁面 \n \n 開始安裝畫面出現 \n \n 7. 完成安裝\xa0 \n', 'tags': '', 'url': 'Virtualbox下載步驟.html'}, {'title': 'VirtualBox操作步驟(W12)', 'text': '\n 1. 先下載軟件安裝 \n \n 2. 開始設定軟件驅動路徑 \n \n 3. 之後開啟虛擬主機，嘗試打開網頁，如打不開網頁可嘗試下列步驟解決 \n \n 帳號密碼kmol2019 \n ifconfig \n cd/etc/netplan \n is -1 \n sudo vi 50-cloud-init.yuml\xa0 按enter \n kmol2019 \n 進入編輯模式，將True變更為False \n 不是DHCP\xa0\xa0 \n 設定addresses \n 啟動-192.168.56.2/24 \n 要有gateway4:192.168.56.1 \n 可重新讀取 \n 跳出編輯模式，按下esc\xa0 \xa0 \xa0:wq \n sudo netplan apply \n ifconfig \n 假如還是開不了網頁，回到根目錄cd \n 回到編輯模式查看是否設定錯誤，cd uwsgi-ini \n \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 is -1 \n \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0sudo vi uwsgi.ini\xa0 \n 源成設定後，即可開啟網頁。 \n \n 分別有兩個網頁需開啟 \n', 'tags': '', 'url': 'VirtualBox操作步驟(W12).html'}, {'title': 'Virtualbox 重新安裝配置(W15)', 'text': '*Ubuntu下載步驟: \n 1. 搜尋ubuntu關鍵字，點擊紅框內的網頁。 \n \n 2. 點入Ubuntu\xa0 Server的頁面。 \n \n 3. 點擊上方下載檔案鍵。 \n \n 4. 下載完成畫面(檔案大小大概800MB左右) \n \n 將UBUNTU檔案事先下載好後即可開始操作以下步驟。 \n 1. 先下載更新Virtualbox6.0版本，將 Virtualbox開啟，新增一個虛擬主機，名稱為"ub-2 \n \n 2. 建立虛擬主機開始點選選項 \n \n \n \n 註:變更為500GB \n \n 3 .點選設定->Network->Bridge...->Rei.... \n \n 4 .按開啟綠色箭頭 \n \n 註:點選ubuntu檔案已設定 \n \n \n 5 .開始12步驟的操作 \n \n \n \n \n \n \n \xa0 \n \n \n \n \n 註:以下為註冊帳號圖例 \n \n \n \n \n 6 .完成畫面 \n', 'tags': '', 'url': 'Virtualbox 重新安裝配置(W15).html'}, {'title': 'Virtualbox操作運用與老師講解', 'text': '如需更加了解virtualboa的由來與詳細的介紹，以下有老師親自介紹的影片 \n \n \n 簡述內容: \n Virtualbox以虛擬程式建立fossil scm軟體，以便不以近端來更新資訊。 \n 例如:置身在無網路的國家中，手持平板即可操作Virtualbox，最後到有網路的區域將資訊一併推送到雲端更新。 \n Virtualbox連接方式分成三種 \n 1. NAT >對外開放 \n 2. Birdged Adapter >互相連結 \n 3. Host-only Adapter >只有自己能連接 \n Virtualbox scope >為變數有效範圍，函數外是全域函數。 \n Virtualbox的按鍵解說: \n K >上 \n J >下 \n H >左 \n L >右 \n Tab or上下>選擇 \n space鍵[x]Install//OpenSSH \n Sudo apt install nginx>1.動能配置 2.開機前設定網路(Bridged Real...) \n Sudo(管理員身分)\xa0 \xa0 \xa0 nginx(3W伺服)', 'tags': '', 'url': 'Virtualbox操作運用與老師講解.html'}, {'title': 'Fossil介紹', 'text': '\n 為何 使用 fossil scm 原因 ->fossil  工具精簡, 適合用於小團隊分散式版次管理, 提供網際 wiki, ticket, technote 等實用功能. \n 1 ->一個 分散式版本控制系統 、 缺陷跟蹤管理系統 以及在 軟體開發 中使用的 wiki軟體 伺服器 \n 2 ->一個 跨平台 伺服器， 能夠提供分散式版本控制、問題跟蹤、 wiki 服務和部落格。 \n 3 ->用戶可以簡單地鍵入「fossil ui」，Fossil就會自動在用戶的 網頁瀏覽器 中開啟一個網頁，提供詳細歷史和狀態資訊。 \n *總結:fossil其作用性與github差不多，主要差別在於容量大小不同，且提供詳細資訊。 \n 假設還想要深入其資訊的話，以下為參考網址 \n -> https://www.fossil-scm.org/home/doc/trunk/www/index.wiki \n', 'tags': '', 'url': 'Fossil介紹.html'}, {'title': 'Fossil術語解釋', 'text': '虎科VPN(校外用)> https://sslvpn9.twaien.net/nfu \n 為何使用intel cpu vt>由於需求為64G，但實際只有32G供應不了，因此採用 intel cpu vt以滿足我們的需求量。 \n ~$ ifconfig\xa0 \xa0->找出動態 \n \n \n \n \n \n \n \n \n \xa0 \xa0 \xa0 \xa0 \xa0 \n \xa0 \xa0 \xa0 \xa0 \xa0 \n \n', 'tags': '', 'url': 'Fossil術語解釋.html'}, {'title': '設計理念', 'text': '\n 1. 設計意圖 \n 2. 設定尺寸or約束 \n 3. 自動推理 \n 4. 繪製精確零件 \n 5. 草圖練習 \n 6. 運用and建立評面 \n 7. 建立援剿or倒角 \n 8. 使用多個草圖區域 \n 9. 基本零件 \n 10. 繪製模型>用於設計意圖 \n 11. 各種簡單的幾何形狀', 'tags': '', 'url': '設計理念.html'}, {'title': 'Solid Work', 'text': '\n 為機械產業中使用頻率最高的軟體。 \n 以下為維基百科解說: https://zh.wikipedia.org/wiki/SolidWorks \n 設計意圖是如何創造者的部分要它響應變化和更新 。 \n SolidWorks的開創能力的用戶回滾透過歷史的一部分，以便進行修改、添加額外的功能或改變順序的操作執行。後來基於特徵的實體建模軟體複製這個想法。 \n 成品操作步驟可參考以下網址: \n https://www.solidworks.com/sw/docs/Instructor_WB_2011_CHT.pdf \n', 'tags': '', 'url': 'Solid Work.html'}, {'title': 'Inventor', 'text': '\n \n https://www.autodesk.com/products/inventor/overview \n 以上維AUTODESK的官方網址，可參閱他們最新版本與資訊。 \n Inventor於各領域解決方案協助使用者有效率地創造、管理和分享其資料和資料資產，幫助用戶實現創意，並轉為具生產力、高效率、高獲利的競爭優勢。 \n 建築、工程與施工業解決方案 \n 不僅可以建構及管理圖形元件，同時也包括了資訊的管理、自動化的產生圖形和報表、設計的分析、工程類比的排程、裝置維護管理等，最終讓建築團隊做出最佳的決策。 \n 讓工作人員、機具及工作能夠更有效的分享資訊，進而消除資料的多餘、資料的重複輸入、資料的遺失或因溝通不良及輾轉傳達所造成的錯誤。 \n 基礎建設業解決方案 \n 幫助 地理資訊系統 專家與土木工程人員之間的合作與共用繪圖與設計資訊，並協助他們提升生產力、簡化內部流程、增加獲利、提供更好的服務以及進一步發揮設計資料的價值。 \n 製造業解決方案 \n 提供了用於建立設計、連接設計鏈、完成製造程式的強大技術，更涵括機具、電工、工具、產業裝置、汽車組件與消費產品，以及可完整類比及分析塑料工程之模流分析工具。 \n 從而解決可能在概念設計、工程和製造等產品開發流程的三個主要階段中發生的不連貫問題以提升生產力和縮減週期為目標。 \n 傳媒暨娛樂業解決方案 \n 製作了能幫助用戶創造魔力的工具，並為後期製作、 廣播 節目、 遊戲 、 動畫 、 Web 之數位內容的建立、效果、編輯以及 3D 應用程式提供最先進的技術。 \n 以下參考資料連結: https://zh.wikipedia.org/wik i/Autodesk \n \n \n', 'tags': '', 'url': 'Inventor.html'}, {'title': '期末報告評分標準', 'text': '\n 每一位學員自我查驗項目: 1 . 是否在第十七週上課前完成個人 至多 5 分鐘的期末報告影片 , 上傳至以學號登錄的 Youtube 帳號下, 並分別嵌入個人網站中, 且標題分別為: \xa0 \xa0 \xa0 四技部網際內容管理課程 \xa0 \xa0 \xa0 國立虎尾科技大學 - 機械設計工程系 - 網際內容管理期末報告 - 學號 - 姓名 \n 2 . 每一位學員 上台進行期末自評簡報 時, 必須 舉證個人在各週實際完成的 Github 倉儲歷程資料, 說明個人在分組與全班協同過程中所扮演的角色與貢獻 , 且依據課程評分比例進行自評. 以下為各課程的學員評分比例與評分方式: \n 評分比例 : \xa0 \xa0 學員出席 (20%) \xa0 \xa0 電腦組裝與操作系統安裝 ( 10% ) - 以 Virtualbox 虛擬主機配置與設定取代實體安裝 \xa0 \xa0 網路連線配置與設定\xa0 ( 10% ) \xa0 \xa0 Github 倉儲與 CMSimfly 配置 ( 30% ) \xa0 \xa0 CMSimfly 操作 ( 20% ) \xa0 \xa0 CMSimfly 開發 ( 10% ) 評分方式 : \xa0 \xa0 WCM 每週自評與互評表單: \xa0 https://goo.gl/forms/gExeWw3JIrenXi453 \xa0 \xa0 學員自我評量 ( 30% ) \xa0 \xa0 分組自我評量 ( 30% ) \xa0 \xa0 倉儲歷程查驗 ( 40% ) \n \n', 'tags': '', 'url': '期末報告評分標準.html'}]};